import React, { Component } from 'react';
import { Link, withRouter } from 'react-router-dom';
import { withFirebase } from '../Firebase';
import firebase from 'firebase';

import './index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import * as ROUTES from '../../constants/routes';
import ReactSearchBox from 'react-search-box'
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';

class scheduling extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      loading: false,
      users: [],
      db: firebase.firestore(),

      columnDefs: [{
        headerName: "Make", field: "make", sortable: true, filter: true
      }, {
        headerName: "Model", field: "model", sortable: true, filter: true
        },{
        headerName: "Price", field: "price", sortable: true, filter: true
      }],
        rowData: [
          { make: "Toyota", model: "Celica", price: 35000 },
          { make: "Ford", model: "Mondeo", price: 32000 },
          { make: "Porsche", model: "Boxter", price: 72000 }]
      
    };
    firebase.firestore().settings({ timestampsInSnapshots: true});

  }

   async getData() {
     let tempDoc = [];
    await this.props.firebase.db.collection('Patient_Details').get().then((querySnapshot) => {
     // const tempDoc = []
      querySnapshot.forEach((doc) => {
         tempDoc.push({ key: doc.id, value:doc.data().name, ...doc.data() })
      })
      console.log(tempDoc);
      this.setState({
        users: tempDoc,
        loading: false,
      });          
   });
   return tempDoc;
  }

  async componentDidMount() {
    this.setState({ loading: true });
    
    await this.props.firebase.db.collection('Patient_Details').get().then((querySnapshot) => {
      const tempDoc = []
      querySnapshot.forEach((doc) => {
         tempDoc.push({ key: doc.id, value:doc.data().name, ...doc.data() })
      })
      console.log(tempDoc);
      this.setState({
        users: tempDoc,
        loading: false,
      });       
   });
	  
  }
  
  componentWillUnmount() {
   // firebase.firestore().collection('patients');
  }  
  
  render() {
    const { users, loading } = this.state;
    //const u = this.getData();
    console.log(users);
    return (
      <div>
      
  <div class="wrap">
   <div class="search">
     <center><h3>Search a patient</h3></center>

     //check now
   <ReactSearchBox 
      placeholder="Enter patient name"
      data={this.state.users}
      onSelect={event =>  window.location.href=ROUTES.SPEECH}
      onFocus={() => {
        //console.log(users);
        //console.log('This function is called when is focussed')
      }}
      onChange={name=>{}}
      fuseConfigs={{
        threshold: 0.05,
      }}
      value=" "
    />

      {/* <input
        type="text"
        name="filter"
        id="filter"
        className="form-control"
        placeholder="Filter Applications"
        onChange={this.filter}
        aria-describedby="filtersearch"
      /> */}

<div className="ag-theme-alpine" style={ {height: '200px', width: '600px'} }>
        <AgGridReact
            columnDefs={this.state.columnDefs}
            rowData={this.state.rowData}>
        </AgGridReact>
      </div>
</div>
 <br/>
    <h4>Or</h4>
    <br/>
    
    <h3> <Link to={ROUTES.PATIENT_REG}>Register new patient</Link></h3>
  </div>
  
  <UserList users={users} />    
  </div>


);
  }
}
//to check
const UserList = ({ users }) => (
  <ul>
    {users.length>0 && users.map(user => (
      <li key={user.key}>
        <span>
          <strong>Email:</strong> {user.email}
        </span>
        
        <span>
          <strong>Name:</strong> {user.name}
        </span>
      </li>
    ))}
  </ul>
);

export default withFirebase(scheduling);
